CREATE TABLE `tbsolicitante` (
  `cod_sol` int NOT NULL AUTO_INCREMENT,
  `nom_sol` varchar(100) NOT NULL,
  `apePat_sol` varchar(100) NOT NULL,
  `apeMat_sol` varchar(100) NOT NULL,
  `dni_sol` varchar(8) NOT NULL,
  `dir_sol` varchar(200) NOT NULL,
  `tel_sol` varchar(9) NOT NULL,
  `correo_sol` varchar(100) NOT NULL,
  `fecha_sol` date NOT NULL,
  `hora_sol` time NOT NULL,
  `foto_usuario` longblob NOT NULL,
  `cod_dist` int NOT NULL,
  `id_usuario` char(5) NOT NULL,
  PRIMARY KEY (`cod_sol`),
  KEY `FKDistrito_Solicitante` (`cod_dist`),
  KEY `FKUsuario_Solicitante` (`id_usuario`),
  CONSTRAINT `FKDistrito_Solicitante` FOREIGN KEY (`cod_dist`) REFERENCES `tbdistrito` (`cod_dist`),
  CONSTRAINT `FKUsuario_Solicitante` FOREIGN KEY (`id_usuario`) REFERENCES `tbusuario` (`id_usuario`)
